const Test = ({query}:any) =>{
    console.log(query)
    return(
        <Layout>
            {query.test}
        </Layout>
    );
}

Test.getInitialProps = async(context:any) =>{
    const query = context.query;
    return{
        query
    }
}
export default Test;
